import React from 'react';
import { connect } from 'react-redux';
import '../word.scss';
import '../styles/sync.scss';
import '../styles/myStyle.scss';
import logo from '../../images/logo3.png';

class Sync extends React.Component {

    state = {
    };

    componentDidMount() {

    }



    render() {

        return (
            <div className="padding-center">

                <div className="mb-3">
                    <label for="exampleFormControlInput1" className="form-label">Selecciona el tablero a trabajar</label>
                    <input type="email" className="form-control" id="exampleFormControlInput1" placeholder="Ingresa el nombre de tu tablero"/>
                </div>
                <div className="mb-3">
                    <label for="exampleFormControlTextarea1" className="form-label">Example textarea</label>
                    <textarea className="form-control" id="exampleFormControlTextarea1" rows="3"></textarea>
                </div>
            </div>
        )
    }
}


export default connect()(Sync);
